function App() {
  return (
    <div>
      <BrowserRouter>
      <Navigation />
      <Switch>
        <Route path="/posts" element={<PostsList />}/>
        <Route path="/todo" element={<TodoList />}/>
        <Route path="/users" element={<UserList />}/>
        <Route path="*" element={<NotFound />}/>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
